import React from "react";
import "./About.css"


function About() {
    return (
        <div className= "about-container">
            <h2 className="about-heading">What We Do</h2>
            <p className="about-paragraph">
                Here at CandyLand we take pride in what we do. Our team has been working on deliviring the best candy known to man since we became a business. As my father once told me, "In order to keep people's attention, you have to give them what they want" which is why your wish is our command, anything candy related of course. We began this company four years ago and since the beginning we've made sure that the whole porcess for selection to delivery be the most efficient in the business. 
            </p>
            <p className="about-paragraph">
                This and many other reasons is why you should buy your candy from CandyLand! 
            </p>
        </div>
    );
}
export default About;
